" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 479px\">",
"   <div class=\"ttl\">",
"    Posterior pelvic tilt",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 459px; height: 180px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The posterior pelvic tilt is a basic maneuver in back rehabilitation. The abdominal and gluteal muscles are contracted to flatten the lumbar spine. This position is held for 5 to 10 seconds and can be repeated frequently.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Sheon, RP, Moskowitz, RW, Goldberg, VM. Soft Tissue Rheumatic Pain: Recognition, Management, Prevention, 3rd ed, Williams &amp; Wilkins, Baltimore 1996.",
"    </div>",
"   </div>",
